_version: 2
error_is_keyword:
  en: "the name `%{name}` cannot be used as a project name, it is a Rust keyword"
  zh_CN: "名称 `%{name}` 不能作为项目名称，它是 Rust 关键字"
  zh_TW: "名稱 `%{name}` 不能作為專案名稱，它是 Rust 關鍵字"
  fr: "le nom `%{name}` ne peut pas être utilisé comme nom de projet, c'est un mot clé Rust"
  ja: "名前 `%{name}` はプロジェクト名として使用できません。これはRustのキーワードです"
  es: "el nombre `%{name}` no se puede usar como nombre de proyecto, es una palabra clave de Rust"
  de: "der Name `%{name}` kann nicht als Projektname verwendet werden, es ist ein Rust-Schlüsselwort"
  ru: "имя `%{name}` нельзя использовать в качестве имени проекта, это ключевое слово Rust"
  it: "il nome `%{name}` non può essere utilizzato come nome del progetto, è una parola chiave Rust"
  pt: "o nome `%{name}` não pode ser usado como nome do projeto, é uma palavra-chave Rust"
  ko: "`%{name}` 이름은 프로젝트 이름으로 사용할 수 없습니다. 이것은 Rust 키워드입니다"
  no: "navnet `%{name}` kan ikke brukes som et prosjektnavn, det er et Rust-nøkkelord"
  is: "nafn `%{name}` má ekki nota sem verkefnanafn, það er lykilorð Rust"
  uk: "ім'я `%{name}` не може бути використано як ім'я проекту, це ключове слово Rust"
  th: "ชื่อ `%{name}` ไม่สามารถใช้เป็นชื่อโปรเจกต์ได้เนื่องจากเป็นคำสำคัญของ Rust"
  el: "το όνομα `%{name}` δεν μπορεί να χρησιμοποιηθεί ως όνομα έργου, είναι μια λέξη-κλειδί Rust"
  da: "navnet `%{name}` kan ikke bruges som et projektnavn, det er et Rust-nøgleord"
error_is_conflicting_artifact_name:
  en: the name `%{name}` will not support binary  executables with that name, \n it conflicts with cargo's build directory names
  zh_CN: 名称 `%{name}` 不支持二进制可执行文件，\n它与 cargo 的构建目录名称冲突
  zh_TW: 名稱 `%{name}` 不支援二進位可執行檔，\n它與 cargo 的建置目錄名稱衝突
  fr: le nom `%{name}` ne prendra pas en charge les exécutables binaires avec ce nom, \n il entre en conflit avec les noms de répertoire de construction de cargo
  ja: 名前 `%{name}` はその名前のバイナリ実行可能ファイルをサポートしません、\n cargoのビルドディレクトリ名と競合します
  es: el nombre `%{name}` no admitirá ejecutables binarios con ese nombre, \n entra en conflicto con los nombres de directorio de compilación de cargo
  de: der Name `%{name}` unterstützt keine ausführbaren Binärdateien mit diesem Namen, \n er steht im Konflikt mit den Build-Verzeichnisnamen von Cargo
  ru: имя `%{name}` не поддерживает двоичные исполняемые файлы с таким именем, \n оно конфликтует с именами каталогов сборки груза
  it: il nome `%{name}` non supporterà eseguibili binari con quel nome, \n entra in conflitto con i nomi delle directory di compilazione di cargo
  pt: o nome `%{name}` não suportará executáveis binários com esse nome, \n entra em conflito com os nomes de diretório de compilação de carga
  ko: error:`%{name}` 이름은 해당 이름의 바이너리 실행 파일을 지원하지 않습니다. \n 카고의 빌드 디렉토리 이름과 충돌합니다
  no: navnet `%{name}` vil ikke støtte binære kjørbare filer med det navnet, \n det er i konflikt med lastebilens byggkatalognavn
  is: nafnið `%{name}` styður ekki keyranlegar tvíundar skrár með því nafni, \n það er í árekstri við byggingar skráarnöfn lastbíls
  uk: ім'я `%{name}` не підтримує бінарні виконувані файли з таким ім'ям, \n воно конфліктує з іменами каталогів збірки вантажівки
  th: ชื่อ `%{name}` จะไม่รองรับไฟล์ที่รันได้ที่มีชื่อนั้น \n มันขัดแย้งกับชื่อไดเรกทอรีการสร้างของ cargo
  el: το όνομα `%{name}` δεν θα υποστηρίξει δυαδικά εκτελέσιμα με αυτό το όνομα, \n συγκρούεται με τα ονόματα καταλόγων δημιουργίας φορτίου
  da: navnet `%{name}` vil ikke understøtte binære eksekverbare filer med det navn, \n det er i konflikt med lastbilens bygningskatalognavne
error_equal_test:
  en: the name `test` cannot be used as a package name, \n it conflicts with Rust's built-in test library
  zh_CN: 名称 `test` 不能作为包名称，\n它与 Rust 内置的测试库冲突
  zh_TW: 名稱 `test` 不能作為套件名稱，\n它與 Rust 內建的測試函式庫衝突
  fr: le nom `test` ne peut pas être utilisé comme nom de package, \n il entre en conflit avec la bibliothèque de test intégrée de Rust
  ja: 名前 `test` はパッケージ名として使用できません、\n Rustの組み込みテストライブラリと競合します
  es: el nombre `test` no se puede usar como nombre de paquete, \n entra en conflicto con la biblioteca de prueba incorporada de Rust
  de: der Name `test` kann nicht als Paketname verwendet werden, \n er steht im Konflikt mit der integrierten Testbibliothek von Rust
  ru: имя `test` нельзя использовать в качестве имени пакета, \n оно конфликтует с встроенной тестовой библиотекой Rust
  it: il nome `test` non può essere utilizzato come nome del pacchetto, \n entra in conflitto con la libreria di test integrata di Rust
  pt: o nome `test` não pode ser usado como nome do pacote, \n entra em conflito com a biblioteca de teste integrada do Rust
  ko: error:`test` 이름은 패키지 이름으로 사용할 수 없습니다. \n Rust의 내장 테스트 라이브러리와 충돌합니다
  no: navnet `test` kan ikke brukes som pakkenavn, \n det er i konflikt med Rusts innebygde testbibliotek
  is: nafnið `test` má ekki nota sem nafn pakka, \n það er í árekstri við innbyggt prófunar safn Rust
  uk: ім'я `test` не може бути використано як ім'я пакета, \n воно конфліктує з вбудованою тестовою бібліотекою Rust
  th: ชื่อ `test` ไม่สามารถใช้เป็นชื่อแพ็คเกจได้ \n มันขัดแย้งกับไลบรารีการทดสอบที่ซ่อนอยู่ของ Rust
  el: το όνομα `test` δεν μπορεί να χρησιμοποιηθεί ως όνομα πακέτου, \n συγκρούεται με την ενσωματωμένη βιβλιοθήκη δοκιμής του Rust
  da: navnet `test` kan ikke bruges som pakkenavn, \n det er i konflikt med Rusts indbyggede testbibliotek
error_part_of_standard_library:
  en: the name `%{name}` is part of Rust's standard library\n It is recommended to use a different name to avoid problems
  zh_CN: 名称 `%{name}` 是 Rust 标准库的一部分\n建议使用其他名称以避免问题
  zh_TW: 名稱 `%{name}` 是 Rust 標準函式庫的一部分\n建議使用其他名稱以避免問題
  fr: le nom `%{name}` fait partie de la bibliothèque standard de Rust\n Il est recommandé d'utiliser un nom différent pour éviter les problèmes
  ja: 名前 `%{name}` はRustの標準ライブラリの一部です\n 問題を避けるために別の名前を使用することをお勧めします
  es: el nombre `%{name}` es parte de la biblioteca estándar de Rust\n Se recomienda usar un nombre diferente para evitar problemas
  de: der Name `%{name}` ist Teil der Standardbibliothek von Rust\n Es wird empfohlen, einen anderen Namen zu verwenden, um Probleme zu vermeiden
  ru: имя `%{name}` является частью стандартной библиотеки Rust\n Рекомендуется использовать другое имя, чтобы избежать проблем
  it: il nome `%{name}` fa parte della libreria standard di Rust\n Si consiglia di utilizzare un nome diverso per evitare problemi
  pt: o nome `%{name}` faz parte da biblioteca padrão do Rust\n É recomendável usar um nome diferente para evitar problemas
  ko: erroe:`%{name}` 이름은 Rust의 표준 라이브러리의 일부입니다\n 문제를 피하기 위해 다른 이름을 사용하는 것이 좋습니다
  no: navnet `%{name}` er en del av Rusts standardbibliotek\n Det anbefales å bruke et annet navn for å unngå problemer
  is: nafnið `%{name}` er hluti af innbyggðu safni Rust\n Það er mælt með að nota annað nafn til að forðast vandamál
  uk: ім'я `%{name}` є частиною стандартної бібліотеки Rust\n Рекомендується використовувати інше ім'я, щоб уникнути проблем
  th: ชื่อ `%{name}` เป็นส่วนหนึ่งของไลบรารีมาตรฐานของ Rust \n แนะนำให้ใช้ชื่ออื่นเพื่อหลีกเลี่ยงปัญหา
  el: το όνομα `%{name}` είναι μέρος της τυπικής βιβλιοθήκης του Rust\n Συνιστάται να χρησιμοποιήσετε διαφορετικό όνομα για να αποφύγετε προβλήματα
  da: navnet `%{name}` er en del af Rusts standardbibliotek\n Det anbefales at bruge et andet navn for at undgå problemer
error_is_windows_reserved:
  en: cannot use name `%{name}`, it is a reserved Windows filename
  zh_CN: 不能使用名称 `%{name}`，它是保留的 Windows 文件名
  zh_TW: 不能使用名稱 `%{name}`，它是保留的 Windows 檔案名稱
  fr: impossible d'utiliser le nom `%{name}`, c'est un nom de fichier Windows réservé
  ja: 名前 `%{name}` は使用できません、それは予約済みのWindowsファイル名です
  es: no se puede usar el nombre `%{name}`, es un nombre de archivo de Windows reservado
  de: der Name `%{name}` kann nicht verwendet werden, es ist ein reservierter Windows-Dateiname
  ru: нельзя использовать имя `%{name}`, это зарезервированное имя файла Windows
  it: non è possibile utilizzare il nome `%{name}`, è un nome file Windows riservato
  pt: não é possível usar o nome `%{name}`, é um nome de arquivo Windows reservado
  ko: error:`%{name}` 이름을 사용할 수 없습니다. 예약 된 Windows 파일 이름입니다
  no: kan ikke bruke navnet `%{name}`, det er et reservert Windows-filnavn
  is: nafnið `%{name}` má ekki nota, það er forvarið Windows skráarheiti
  uk: не можна використовувати ім'я `%{name}`, це зарезервоване ім'я файлу Windows
  th: ไม่สามารถใช้ชื่อ `%{name}` ได้เนื่องจากเป็นชื่อไฟล์ Windows ที่สงวนไว้
  el: δεν μπορείτε να χρησιμοποιήσετε το όνομα `%{name}`, είναι ένα κρατημένο όνομα αρχείου Windows
  da: kan ikke bruge navnet `%{name}`, det er et reserveret Windows-filnavn
warning_is_windows_reserved:
  en: the name `%{name}` is a reserved Windows filename\n This package will not work on Windows platforms.
  zh_CN: 名称 `%{name}` 是保留的 Windows 文件名\n此包将无法在 Windows 平台上工作。
  zh_TW: 名稱 `%{name}` 是保留的 Windows 檔案名稱\n此套件將無法在 Windows 平台上工作。
  fr: le nom `%{name}` est un nom de fichier Windows réservé\n Ce package ne fonctionnera pas sur les plates-formes Windows.
  ja: 名前 `%{name}` は予約済みのWindowsファイル名です\n このパッケージはWindowsプラットフォームでは動作しません。
  es: el nombre `%{name}` es un nombre de archivo de Windows reservado\n Este paquete no funcionará en plataformas Windows.
  de: der Name `%{name}` ist ein reservierter Windows-Dateiname\n Dieses Paket funktioniert nicht auf Windows-Plattformen.
  ru: имя `%{name}` является зарезервированным именем файла Windows\n Этот пакет не будет работать на платформах Windows.
  it: il nome `%{name}` è un nome file Windows riservato\n Questo pacchetto non funzionerà su piattaforme Windows.
  pt: o nome `%{name}` é um nome de arquivo Windows reservado\n Este pacote não funcionará em plataformas Windows.
  ko: error:`%{name}` 이름은 예약 된 Windows 파일 이름입니다\n이 패키지는 Windows 플랫폼에서 작동하지 않습니다.
  no: navnet `%{name}` er et reservert Windows-filnavn\n Denne pakken vil ikke fungere på Windows-plattformer.
  is: nafnið `%{name}` er forvarið Windows skráarheiti\n Þessi pakki virkar ekki á Windows vélum.
  uk: ім'я `%{name}` є зарезервованим ім'ям файлу Windows\n Цей пакет не працюватиме на платформах Windows.
  th: ชื่อ `%{name}` เป็นชื่อไฟล์ Windows ที่สงวนไว้\n แพ็คเกจนี้จะไม่ทำงานบนแพลตฟอร์ม Windows
  el: το όνομα `%{name}` είναι ένα κρατημένο όνομα αρχείου Windows\n Αυτό το πακέτο δεν θα λειτουργήσει σε πλατφόρμες Windows.
  da: navnet `%{name}` er et reserveret Windows-filnavn\n Denne pakke fungerer ikke på Windows-platforme.
warning_is_non_ascii_name:
  en: the name `%{name}` contains non-ASCII characters\n Non-ASCII crate names are not supported by Rust.
  zh_CN: 名称 `%{name}` 包含非 ASCII 字符\nRust 不支持非 ASCII 的包名称。
  zh_TW: 名稱 `%{name}` 包含非 ASCII 字元\nRust 不支援非 ASCII 的套件名稱。
  fr: le nom `%{name}` contient des caractères non-ASCII\n Les noms de caisses non-ASCII ne sont pas pris en charge par Rust.
  ja: 名前 `%{name}` にはASCII以外の文字が含まれています\n ASCII以外のクレート名はRustではサポートされていません。
  es: el nombre `%{name}` contiene caracteres no ASCII\n Los nombres de cajas no ASCII no son compatibles con Rust.
  de: der Name `%{name}` enthält nicht-ASCII-Zeichen\n Nicht-ASCII-Kistenamen werden von Rust nicht unterstützt.
  ru: имя `%{name}` содержит символы не ASCII\n Имена ящиков не ASCII не поддерживаются Rust.
  it: il nome `%{name}` contiene caratteri non ASCII\n I nomi delle casse non ASCII non sono supportati da Rust.
  pt: o nome `%{name}` contém caracteres não ASCII\n Nomes de caixas não ASCII não são suportados pelo Rust.
  ko: error:`%{name}` 이름에는 ASCII가 아닌 문자가 포함되어 있습니다\n ASCII가 아닌 크레이트 이름은 Rust에서 지원되지 않습니다.
  no: navnet `%{name}` inneholder ikke-ASCII-tegn\n Ikke-ASCII-kasse navn støttes ikke av Rust.
  is: nafnið `%{name}` inniheldur ekki ASCII stafi\n Ekki ASCII kassa nöfn eru ekki studd af Rust.
  uk: ім'я `%{name}` містить символи не ASCII\n Імена ящиків не ASCII не підтримуються Rust.
  th: ชื่อ `%{name}` มีอักขระที่ไม่ใช่ ASCII\n ชื่อกระบอกที่ไม่ใช่ ASCII ไม่ได้รับการสนับสนุนโดย Rust
  el: το όνομα `%{name}` περιέχει μη ASCII χαρακτήρες\n Τα ονόματα κιβωτίων μη ASCII δεν υποστηρίζονται από το Rust.
  da: navnet `%{name}` indeholder ikke-ASCII-tegn\n Ikke-ASCII-kasse navne understøttes ikke af Rust.
warning_invalid_path:
  en: the path `%{path}` contains invalid PATH characters (usually `:`, `;`, or `\"`)\n It is recommended to use a different name to avoid problems
  zh_CN: 路径 `%{path}` 包含无效的路径字符（通常是 `:`、`;` 或 `\"`）\n建议使用其他名称以避免问题
  zh_TW: 路徑 `%{path}` 包含無效的路徑字元（通常是 `:`、`;` 或 `\"`）\n建議使用其他名稱以避免問題
  fr: le chemin `%{path}` contient des caractères de chemin non valides (généralement `:`, `;` ou `\"`)\n Il est recommandé d'utiliser un nom différent pour éviter les problèmes
  ja: パス `%{path}` には無効なパス文字が含まれています（通常は `:`、`;` または `\"`）\n 問題を避けるために別の名前を使用することをお勧めします
  es: la ruta `%{path}` contiene caracteres de ruta no válidos (generalmente `:`, `;` o `\"`)\n Se recomienda usar un nombre diferente para evitar problemas
  de: der Pfad `%{path}` enthält ungültige Pfadzeichen (normalerweise `:`, `;` oder `\"`)\n Es wird empfohlen, einen anderen Namen zu verwenden, um Probleme zu vermeiden
  ru: путь `%{path}` содержит недопустимые символы пути (обычно `:`, `;` или `\"`)\n Рекомендуется использовать другое имя, чтобы избежать проблем
  it: il percorso `%{path}` contiene caratteri di percorso non validi (di solito `:`, `;` o `\"`)\n Si consiglia di utilizzare un nome diverso per evitare problemi
  pt: o caminho `%{path}` contém caracteres de caminho inválidos (geralmente `:`, `;` ou `\"`)\n É recomendável usar um nome diferente para evitar problemas
  ko: error:`%{path}` 경로에 유효하지 않은 경로 문자가 포함되어 있습니다 (일반적으로 `:`, `;` 또는 `\"`)\n 문제를 피하기 위해 다른 이름을 사용하는 것이 좋습니다
  no: stien `%{path}` inneholder ugyldige sti-tegn (vanligvis `:`, `;` eller `\"`)\n Det anbefales å bruke et annet navn for å unngå problemer
  is: slóðin `%{path}` inniheldur ógild staf (venjulega `:`, `;` eða `\"`)\n Það er mælt með að nota annað nafn til að forðast vandamál
  uk: шлях `%{path}` містить недійсні символи шляху (зазвичай `:`, `;` або `\"`)\n Рекомендується використовувати інше ім'я, щоб уникнути проблем
  th: พาธ `%{path}` มีอักขระที่ไม่ถูกต้อง (โดยปกติ `:`, `;` หรือ `\"`)\n แนะนำให้ใช้ชื่ออื่นเพื่อหลีกเลี่ยงปัญหา
  el: η διαδρομή `%{path}` περιέχει μη έγκυρους χαρακτήρες διαδρομής (συνήθως `:`, `;` ή `\"`)\n Συνιστάται να χρησιμοποιήσετε διαφορετικό όνομα για να αποφύγετε προβλήματα
  da: stien `%{path}` indeholder ugyldige sti-tegn (normalt `:`, `;` eller `\"`)\n Det anbefales at bruge et andet navn for at undgå problemer
erroe_join_paths:
  en: failed to join paths from `$%{env}` together\n Check if any of path segments listed below contain an \n unterminated quote character or path separator
  zh_CN: 无法将 `$%{env}` 中的路径连接在一起\n请检查下面列出的路径段中是否包含未终止的引号字符或路径分隔符
  zh_TW: 無法將 `$%{env}` 中的路徑連接在一起\n請檢查下面列出的路徑段中是否包含未終止的引號字元或路徑分隔符
  fr: failed to join paths from `$%{env}` together\n Vérifiez si l'un des segments de chemin répertoriés ci-dessous contient un \n caractère de guillemet non terminé ou un séparateur de chemin
  ja: error:`$%{env}` からパスを結合できませんでした\n 以下にリストされているパスセグメントのいずれかに、\n 終了していない引用符文字またはパスセパレータが含まれていないか確認してください
  es: no se pudo unir las rutas de `$%{env}` juntas\n Compruebe si alguno de los segmentos de ruta enumerados a continuación contiene un \n carácter de comillas sin terminar o un separador de ruta
  de: fehlgeschlagen, um Pfade von `$%{env}` zusammenzuführen\n Überprüfen Sie, ob einer der unten aufgeführten Pfadsegmente enthält ein \n nicht abgeschlossenes Anführungszeichen oder Pfadtrennzeichen
  ru: error:`$%{env}` не удалось объединить пути\n Проверьте, содержит ли один из перечисленных ниже сегментов пути \n не завершенный символ кавычки или разделитель пути
  it: impossibile unire i percorsi da `$%{env}` insieme\n Controlla se uno dei segmenti di percorso elencati di seguito contiene un \n carattere di virgoletta non terminato o un separatore di percorso
  pt: falha ao unir caminhos de `$%{env}` juntos\n Verifique se algum dos segmentos de caminho listados abaixo contém um \n caractere de aspas não terminado ou separador de caminho
